import React from 'react'; 
import UsersList from '../components/UsersList'

const Users = () => {
    const USERS = [
        {
            id: 'u1', 
            name: 'Carl Diederichs', 
            image: 'https://avatars.githubusercontent.com/u/52462273?v=4', 
            places: 3
        }
    ];

    return <UsersList items={USERS}/>;
};

export default Users;
